    function arr_index(arr, str) {
      for (var i = 0; i < arr.length; i++) {
        if (arr[i] === str) {
          return i;
        }
      };
      return -1;
    }

    function prepare_calendar() {
      var $calendar_view  = $('.view-cal-event > .view-content');
      var date_format     = 'yy-mm-dd';
      var $days           = $calendar_view.children('.day');
      var populated_dates = [];

      $days.each(function() {
        var date = $(this).data('date');
        populated_dates.push(date);
      });

      function format_day(date) {
        var formatted_date = $.datepicker.formatDate(date_format, date);
        var day_class = '';
        if (arr_index(populated_dates, formatted_date) >= 0) {
          day_class = "has-event";
        }
        return [true, day_class];
      }

      function select_day(dateText) {
        $calendar_view.find('.no-results').remove();
        $days.hide();
        var $day_to_show = $calendar_view.find('.day[data-date="' + dateText + '"]');
        if ($day_to_show.length > 0) {
          $day_to_show.show();
        }
        else {
          $calendar_view.append('<div class="no-results">No results for this entry</div>');
        }
      }

      $('.view-cal-event').prepend('<div id="calendar-events-datepicker"></div>');
      if (jQuery.datepicker !== undefined) {
        $('#calendar-events-datepicker').datepicker({
          dateFormat: date_format,
          dayNamesMin: [ "S", "M", "T", "W", "T", "F", "S" ],
          onSelect: select_day,
          beforeShowDay: format_day
        });
        select_day($.datepicker.formatDate(date_format, new Date()));
      }
    }
    prepare_calendar();

    // =========================================================
    // FIREFOX MENU FIX
    // =========================================================
    function firefox_menu_fix() {
      var browser = 'Firefox';
      var uaStr   = navigator.userAgent;
      var s       = uaStr.indexOf(browser);
      if (s >= 0) {
        // Find specific version
        var e       = uaStr.indexOf('.', s);
        var sub     = uaStr.substring(s + browser.length + 1, e);
        var version = parseFloat(sub);

        if (version < 30) {
          // Apply fix to versions under 30.
          // console.log("Using Firefox Menu Fix on firefox: " + sub);
          $('#superfish-1').children().each(function() {
            var $this = $(this);
            var $child = $this.children('ul');
            $child.css({
              'min-width': $this.width(),
              'left': 'inherit',
              'right': 'inherit',
              'top': 'inherit'
            });
            // Right align last item
            if ($this.hasClass('last')) {
              $child.css({
                'margin-left': Math.floor($child.width() - $this.width() - 1) * -1
              });
            }
          });
        }
      }
    }
    firefox_menu_fix();

