    function content_right_side_fix() {
      var children_store = [];
      var $right_side_elements = $('.field-name-field-right-column .field-item').find('h2').parent().children();

      // If 2 elements or more then should have h2 and body.
      if ($right_side_elements.length > 0 ) {
        $right_side_elements.each(function(idx, item) {
          var $this = $(this);
          if ($this.is('h2')) {
            // Stop storing before
            if (children_store.length > 0) {
              $(children_store).wrap('<div class="right-side-body" />');
              children_store = [];
            }
          }
          else {
            // Start storing
            children_store.push($this);
          }
          // If last element, then push
          if (idx === ($right_side_elements.length - 1)) {
            $(children_store).wrap('<div class="right-side-body" />');
          }
        });
      }
    }
